import React, { useState, useEffect } from "react";
import { useParams, NavLink } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getParoisse } from "../actions/paroisse";
import { isEmpty } from "../components/utils";

const Paroisse = () => {
  const [isLoading, setIsLoading] = useState(true);
  const [paroisse, setParoisse] = useState({});
  const { id } = useParams();
  const dispatch = useDispatch();

  useEffect(() => {
    if (isLoading) {
      dispatch(getParoisse(id));
      setParoisse(useSelector((state) => state.paroisse));
    }
  }, [id]);

  return (
    <div className="paroisse-container">
      <div className="paroisse-header">
        <h1>Paroisse</h1>
      </div>
      <p>{id}</p>
      <p>{paroisse.name}</p>
    </div>
  );
};

export default Paroisse;
